/*Table structure for table `hr_incentive_bonus` */

DROP TABLE IF EXISTS `hr_incentive_bonus`;

CREATE TABLE `hr_incentive_bonus` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `as_id` int(10) unsigned NOT NULL,
  `date` date NOT NULL,
  `amount` double(8,2) NOT NULL,
  `target_given` double(8,2) DEFAULT NULL,
  `target_achieve` double(8,2) DEFAULT NULL,
  `pay_status` tinyint(4) NOT NULL DEFAULT '0',
  `pay_date` date DEFAULT NULL,
  `style_id` int(10) unsigned DEFAULT NULL,
  `line_id` int(10) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `date` (`as_id`),
  KEY `hr_incentive_bonus_as_id_date_index` (`as_id`,`date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

